import  React from 'react';

const ListDemand = ()=>{
    return(
        <Container>
            <Grid container>
            <Grid item md={12}>
              <Typography variant="h4">Solicitudes Realizadas </Typography>

            </Grid>
              <Grid item md={3}>
                <TextField></TextField>
            </Grid>
            <Grid item md={3}>
                <TextField></TextField>
            </Grid>
            <Grid item md={3}>
                <TextField></TextField>
            </Grid>
            <Grid item md={3}>
                <TextField></TextField>
            </Grid>
            </Grid>
        </Container>
    );
}

export default ListDemand;
